import React from "react";
import './app.css';
import {Navbar,Head} from './components/export';
import { BrowserRouter,Route, Routes } from "react-router-dom";
export default function App() {
  return (
    <BrowserRouter>
      <Routes path='/' element={<Navbar />}>
        <Route index element={<Head />} />
        {/* <Route index element={} /> */}
        
      </Routes>

      {/* <div className="app ">
        <Navbar />
      </div> */}
    </BrowserRouter>
  );
}
